use alloy::hex;
use anyhow::Result;
use std::{path::PathBuf, str::FromStr};
use tokio::sync::mpsc;
use tokio::io::AsyncWriteExt;
use tracing::{info, error};
use revm::{
    database::CacheDB, database_interface::EmptyDB, primitives::{Address, Bytes, KECCAK_EMPTY}, state::{AccountInfo, Bytecode}
};


use crate::two_fa::node::{TwoFaNode, TransactionValidation};

pub async fn run_two_fa_node(
    main_node_address: String,
) -> Result<()> {
    info!("Starting ZKsync OS 2FA Node");
    info!("2FA main node address: {}", main_node_address);

    let (validation_sender, mut validation_receiver) = mpsc::unbounded_channel::<TransactionValidation>();
    let two_fa_node = TwoFaNode::new(main_node_address, validation_sender);

    let two_fa_handle = tokio::spawn(async move {
        let mut in_memory_db = CacheDB::<EmptyDB>::default();
        
        // TODO: look how genesis is loaded for the main node
        let accounts = vec![
        (
            Address::from_str("0x000000000000000000000000000000000000800f").unwrap(),
            AccountInfo {
                code_hash: KECCAK_EMPTY,
                code: Some(Bytecode::new_raw(Bytes::from(&hex!("")))),
                ..Default::default()
            }
        ),
                (
            Address::from_str("0x0000000000000000000000000000000000010001").unwrap(),
            AccountInfo {
                code_hash: KECCAK_EMPTY,
                code: Some(Bytecode::new_raw(Bytes::from(&hex!("")))),
                ..Default::default()
            }
        ),
        (
            Address::from_str("0x0000000000000000000000000000000000010007").unwrap(),
            AccountInfo {
                code_hash: KECCAK_EMPTY,
                code: Some(Bytecode::new_raw(Bytes::from(&hex!("")))),
                ..Default::default()
            }
        )];
        let contracts = vec![
            AccountInfo {
                code_hash: KECCAK_EMPTY,
                code: Some(Bytecode::new_raw(Bytes::from(&hex!("")))),
                ..Default::default()
            },
            AccountInfo {
                code_hash: KECCAK_EMPTY,
                code: Some(Bytecode::new_raw(Bytes::from(&hex!("")))),
                ..Default::default()
            },
            AccountInfo {
                code_hash: KECCAK_EMPTY,
                code: Some(Bytecode::new_raw(Bytes::from(&hex!("")))),
                ..Default::default()
            },
            AccountInfo {
                code_hash: KECCAK_EMPTY,
                code: Some(Bytecode::new_raw(Bytes::from(&hex!("")))),
                ..Default::default()
            },
            AccountInfo {
                code_hash: KECCAK_EMPTY,
                code: Some(Bytecode::new_raw(Bytes::from(&hex!("")))),
                ..Default::default()
            },
            AccountInfo {
                code_hash: KECCAK_EMPTY,
                code: Some(Bytecode::new_raw(Bytes::from(&hex!("")))),
                ..Default::default()
            },
        ];
        for (x,y ) in accounts {
            in_memory_db.insert_account_info(x, y);
        }
        for mut x in contracts {
            in_memory_db.insert_contract(&mut x);
        }

        if let Err(e) = two_fa_node.start(in_memory_db).await { error!("2FA node failed: {}", e); }
    });

    let results_handle = tokio::spawn(async move {
        process_validation_results(&mut validation_receiver, None).await;
    });

    tokio::select! {
        result = two_fa_handle => { match result { Ok(_) => info!("2FA node completed successfully"), Err(e) => error!("2FA node task failed: {}", e), } }
        result = results_handle => { match result { Ok(_) => info!("Validation results processor completed"), Err(e) => error!("Validation results processor failed: {}", e), } }
    }

    Ok(())
}

async fn process_validation_results(
    validation_receiver: &mut mpsc::UnboundedReceiver<TransactionValidation>,
    output_file: Option<PathBuf>,
) {
    let mut total_validations = 0;
    let mut failed_validations = 0;
    let mut total_execution_time = 0u64;

    let mut file_writer = if let Some(path) = output_file {
        match tokio::fs::File::create(path).await { Ok(file) => Some(tokio::io::BufWriter::new(file)), Err(e) => { error!("Failed to create output file: {}", e); None } }
    } else { None };

    while let Some(validation) = validation_receiver.recv().await {
        total_validations += 1;
        total_execution_time += validation.execution_time_ms;
        if validation.success { info!("✓ Transaction {} validated successfully ({}ms)", validation.tx_hash, validation.execution_time_ms); } else {
            failed_validations += 1;
            error!("✗ Transaction {} validation failed ({}ms)", validation.tx_hash, validation.execution_time_ms);
        }
        if let Some(writer) = &mut file_writer {
            let json_result = serde_json::json!({
                "tx_hash": validation.tx_hash,
                "success": validation.success,
                "execution_time_ms": validation.execution_time_ms,
                "state_diff_matches": validation.state_diff_comparison.matches,
                "discrepancies_count": validation.state_diff_comparison.discrepancies.len(),
                "gas_discrepancy": validation.state_diff_comparison.gas_discrepancy,
            });
            if let Err(e) = tokio::io::AsyncWriteExt::write_all(writer, format!("{}\n", json_result).as_bytes()).await { error!("Failed to write validation result to file: {}", e); }
        }
        let avg_execution_time = total_execution_time / total_validations;
        info!("Progress: {} validations completed ({} failed), avg time: {}ms", total_validations, failed_validations, avg_execution_time);
    }

    let avg_execution_time = if total_validations > 0 { total_execution_time / total_validations } else { 0 };
    info!("Validation complete: {} total, {} failed, avg time: {}ms", total_validations, failed_validations, avg_execution_time);
    if let Some(mut writer) = file_writer { if let Err(e) = writer.flush().await { error!("Failed to flush output file: {}", e); } }
}
